import React from 'react';
import ProfileInfo from './ProfileInfo/ProfileInfo';
import Posts from './Posts/Posts';
import styles from './Profile.module.css';


const Profile = (props) => {
    return <div className={styles.profile}>
        <ProfileInfo profile={props.ProfilePage.profile} status={props.status} updateStatus={props.updateStatusThunk} />
        <Posts updatePost={props.updatePost} sendPost={props.sendPost} posts={props.ProfilePage.posts} currentTextPost={props.ProfilePage.currentTextPost} />
    </div>
}

export default Profile;
